import React, { Component } from "react";

export default class Line extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <tr>
          <td>this.props.item._id</td>
          <td>this.props.item.username</td>
          <td>this.props.item.password</td>
        </tr>
      </div>
    );
  }
}
